import './App.css';
import Introd from "./Components/Introd/Introd";
import Works from "./Components/Works/Works";
import {Moving,Moving2, Moving3}  from "./Components/Moving/Moving";
import Process from './Components/Process/Process';



function App() {
  return (
    <div className="App">
      <Navbar />
      <Introd />
      <Works />
      <Moving />
      <Moving2 />
      <Moving3/>
      <Process />
      <div class="sketchfab-embed-wrapper"> <iframe title="laptop" frameborder="0" allowfullscreen mozallowfullscreen="true" webkitallowfullscreen="true" allow="autoplay; fullscreen; xr-spatial-tracking" xr-spatial-tracking execution-while-out-of-viewport execution-while-not-rendered web-share src="https://sketchfab.com/models/d2b3ba347ffa4623a2ebc066050d8763/embed"> </iframe> <p style="font-size: 13px; font-weight: normal; margin: 5px; color: #4A4A4A;"> <a href="https://sketchfab.com/3d-models/laptop-d2b3ba347ffa4623a2ebc066050d8763?utm_medium=embed&utm_campaign=share-popup&utm_content=d2b3ba347ffa4623a2ebc066050d8763" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;"> laptop </a> by <a href="https://sketchfab.com/sangar17?utm_medium=embed&utm_campaign=share-popup&utm_content=d2b3ba347ffa4623a2ebc066050d8763" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;"> sangar17 </a> on <a href="https://sketchfab.com?utm_medium=embed&utm_campaign=share-popup&utm_content=d2b3ba347ffa4623a2ebc066050d8763" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;">Sketchfab</a></p></div>
    </div>
  );
}

export default App;
